I'd be happy to help! However, I need to clarify that writing the entire code for a 2D platformer game in Unity3D would require an enormous amount of code and would likely exceed the character limit of this chat.

Instead, I can provide you with a basic structure and some essential scripts to get you started. We'll cover the following aspects:

1. Player movement and jumping.
2. Collision detection and response.
3. Platform creation and management.

Please note that this is not a complete game, to create a fully functional game you will need to add more features such as enemies, graphics, sound effects, UI, scoring system etc...

Here's a breakdown of the scripts we'll need:

**PlayerController.cs**
```csharp

using System.Collections;
using System.Collections.Generic;
using UnityEngine;

public class PlayerController : MonoBehaviour {

    public float moveSpeed = 5f;
    public float jumpForce = 10f;

    private Rigidbody2D rb;
    private bool isJumping = false;

    void Start() {
        rb = GetComponent<Rigidbody2D>();
    }

    void Update() {
        MovePlayer();
        Jump();
    }

    void MovePlayer() {
        float horizontalInput = Input.GetAxis("Horizontal");
        Vector2 movement = new Vector2(horizontalInput * moveSpeed, rb.velocity.y);
        rb.velocity = movement;
    }

    void Jump() {
        if (Input.GetKeyDown(KeyCode.Space) &&!isJumping) {
            rb.AddForce(new Vector2(0f, jumpForce), ForceMode2D.Impulse);
            isJumping = true;
        }
    }

    void OnCollisionEnter2D(Collision2D collision) {
        if (collision.gameObject.CompareTag("Platform")) {
            isJumping = false;
        }
    }
}
```

